def day4(s, *, part2=False):
  copies = collections.Counter()
  total = 0

  for card_id, line in enumerate(s.splitlines()):
    winning, have = map(str.split, line.split(':')[1].split(' | '))
    num_matches = len(set(winning) & set(have))
    if part2:
      value = 1 + copies[card_id]
      for i in range(num_matches):
        copies[card_id + 1 + i] += value
      total += value
    elif num_matches:
      total += 2 ** (num_matches - 1)

  return total

#include <stdexcept>

template <typename T>
class List {
private:
    T* p_list = nullptr;
    size_t m_count = 0;

public:
    List() = default;
    ~List() 
    {
        if (p_list)
        {
            delete[] p_list;
            p_list = nullptr;
        }
    }

    List<T>& add(T value)
    {
        T* newList = new T[m_count + 1];
        
        if (this->p_list)
        {
            for (size_t i = 0; i < m_count; i++)
            {
                newList[i] = p_list[i];
            }

            delete[] p_list;
        }

        newList[m_count++] = value;

        p_list = newList;

        return *this;
    }

    List<T>& add(T* arr, size_t size)
    {
        T* newList = new T[m_count + size];

        if (this->p_list)
        {
            for (size_t i = 0; i < m_count; i++)
            {
                newList[i] = p_list[i];
            }

            delete[] p_list;
        }

        for (size_t i = 0; i < size; i++)
        {
            newList[m_count + i] = arr[i];
        }

        p_list = newList;

        m_count += size;

        return *this;
    }

    List<T>& clear()
    {
        if (this->p_list)
        {
            delete[] this->p_list;
            this->p_list = nullptr;
            this->m_count = 0;
        }

        return *this;
    }

    size_t count() const
    {
        return m_count;
    }

    T& get(size_t index) const
    {
        if (index >= m_count)
        {
            throw std::invalid_argument("Index must be within the bounds of the list.");
        }

        return p_list[index];
    }

    List<T>& insert(T value, size_t index)
    {
        if (index > m_count)
        {
            throw std::invalid_argument("Index must be within the bounds of the list.");
        }

        m_count++;
        size_t mod = 0;
        T* newList = new T[m_count];

        for (size_t i = 0; i < m_count; i++)
        {
            if (i == index) {
                newList[i] = value;
                mod++;
            }
            else
                newList[i] = p_list[i - mod];
        }

        if (p_list)
            delete[] p_list;

        p_list = newList;

        return *this;
    }

    List<T>& remove(size_t index)
    {
        if (index >= m_count)
        {
            throw std::invalid_argument("Index must be within the bounds of the list.");
        }

        size_t mod = 0;
        T* newList = new T[m_count];

        for (size_t i = 0; i < m_count; i++)
        {
            if (i == index) {
                mod++;
                continue;
            }

            newList[i - mod] = p_list[i];
        }

        if (p_list)
            delete[] p_list;

        m_count--;
        p_list = newList;
        
        return *this;
    }

    List<T>& resize(size_t size)
    {
        T* newList = new T[size];

        m_count = size;

        if (this->p_list)
        {
            for (size_t i = 0; i < m_count; i++)
            {
                newList[i] = p_list[i];
            }

            delete[] p_list;
        }

        for (size_t i = 0; i < (size - m_count); i++)
        {
            newList[m_count + i] = T();
        }

        p_list = newList;

        return *this;
    }

    List<T>& reverse()
    {
        T* newList = new T[m_count];

        for (size_t i = 0; i < m_count; i++)
        {
            newList[i] = p_list[m_count- i - 1];
        }

        if (this->p_list)
            delete[] p_list;

        p_list = newList;

        return *this;
    }

    T operator[](size_t index) const
    {
        if (index >= m_count) {
   
            throw std::invalid_argument("Index must be within the bounds of the list.");
        }
        return p_list[index];
    }

    T& operator[](size_t index)
    {
        if (index >= m_count) {

            throw std::invalid_argument("Index must be within the bounds of the list.");
        }
        return p_list[index];
    }

    T& operator+=(const T& other)
    {
        add(other);
        return *end();
    }

    T& operator++(int)
    {
        resize(m_count + 1);
        return *end();
    }

    T& operator--(int)
    {
        resize(m_count - 1);
        return *end();
    }

    T* begin() const
    {
        return p_list;
    }

    T* end() const
    {
        return p_list + m_count;
    }
};

public class Day4B {
    public static void main(String[] args) throws IOException {
        var arr = (ArrayList<String>) Files.readAllLines(Paths.get("C:/dev/advent-of-code/inputs/t"));
        var freq = new int[arr.size() + 1];
        Arrays.fill(freq, 1);
        int ans = 0, i = 0;
        while(i < arr.size()){
            while(freq[i]--> 0) {
                ans++;
                var line = arr.get(i);
                var sp = line.split(":");
                var win = sp[1].substring(0, sp[1].indexOf("|"));
                var set = new HashSet<Integer>();
                for (var n : win.trim().split(" ")) {
                    if (!n.isBlank()) set.add(Integer.parseInt(n));
                }
                var me = sp[1].substring(sp[1].indexOf("|") + 1);
                int count = 0, m = 0;
                for (var n : me.trim().split(" ")) {
                    if (!n.isBlank()) if (set.contains(Integer.parseInt(n))) {
                        m++;
                    }
                }
                for (int x = 1; x <= m; x++) {
                    freq[i + x]++;
                }
            }
            i++;
        }
        print("%d", ans);
    }
}

const fs = require("fs")
const performance = require("perf_hooks").performance
const eol = require("os").EOL

let startTime = performance.now()
let part1 = (part2 = 0)
let input = fs.readFileSync(__dirname + "/data.txt", "utf8").split(eol)

let games = input.map((item) => {
    return item
        .split(": ")[1]
        .split("| ")
        .map((nums) => {
            return nums.match(/\d+/g)
        })
})

let multiTable = Array(games.length).fill(1)
for (let i = 0; i < games.length; i++) {
    const filteredArray = games[i][1].filter((value) => games[i][0].includes(value))
    part1 += filteredArray.length > 0 ? 1 * Math.pow(2, filteredArray.length - 1) : 0
    for (let j = 0; j < filteredArray.length; j++) {
        multiTable[j + 1 + i] += ~~multiTable[i]
    }
}

part2 = multiTable.reduce((partialSum, a) => partialSum + a, 0)
let time = performance.now() - startTime
console.log(`Part 1: ${part1}\nPart 2: ${part2}\nTimer: ${time} ms`)

