int gcd(int a, int b) {
    if (a == 0 || b == 0) {
        return a + b;
    }
    if (a > b) {
        return gcd(a % b, b);
    }
    else {
        return gcd(a, b % a);
    }
}

bool mozh(int x, int v, int n) {
    int res = 1;
    for (int i = 0; i < v; i++) {
        res *= x;
        if (res > N) {
            return false;
        }
    }
    if (binary_search(all(pw_ful[n]), res)) {
        return true;
    }
    else {
        return false;
    }
}

int go(int x, int v, int n) {
    int res = 1;
    for (int i = 0; i < v; i++) {
        res *= x;
    }
    for (auto it : sq[res]) {
        if (it.second == n) {
            return it.first;
        }
    }
}

vector <int> solve_smart(int n, int q) {
    int l, r, act, k, i, j, x, mx = -1, vv, nn, vv2, nn2, ans;
    for (i = 1; i <= N; i++) {
        keys[i].clear();
    }
    vector <pair <int, int> > drobi;
    set <pair <int, int> > mzh, sup, sup2;
    vector <int> result, usless;
    for (vv = 1; vv < 18; vv++) {
        for (nn = 1; nn < 18; nn++) {
            x = gcd(vv, nn);
            mzh.insert({ vv / x, nn / x });
        }
    }
    for (i = 1; i <= n; i++) {
        mx = max(mx, a[i]);
        p[i] = p[i - 1] + a[i];
        keys[a[i]].push_back(i);
        usless.push_back(a[i]);
        sup.clear();
        sup2.clear();
        for (vv = 1; vv < 18; vv++) {
            for (nn = 1; nn < 18; nn++) {
                x = gcd(vv, nn);
                if (mozh(a[i], vv / x, nn / x)) {
                    sup.insert({ vv / x, nn / x });
                }
            }
        }
        for (auto it : sup) {
            if (mzh.find(it) != mzh.end()) {
                sup2.insert(it);
            }
        }
        mzh.swap(sup2);
    }
    for (auto it : mzh) {
        drobi.push_back(it);
    }
    sort(all(usless));
    usless.resize(unique(all(usless)) - usless.begin());
    bool poh = (mx == 1) || (drobi.size() == 1);
    for (auto it : usless) {
        for (i = 0; i < drobi.size(); i++) {
            refr[it][i] = go(it, drobi[i].first, drobi[i].second);
        }
    }
    vv = 1, nn = 1;
    for (i = 1; i <= q; i++) {
        act = Q[i].first;
        k = Q[i].second.first;
        l = Q[i].second.first;
        r = Q[i].second.second;
        if (act == 1) {
            vv2 = vv * k;
            nn2 = nn;
            x = gcd(vv2, nn2);
            if (mzh.find({ vv2 / x, nn2 / x }) != mzh.end()) {
                vv = vv2 / x;
                nn = nn2 / x;
            }
        }
        else if (act == 2) {
            vv2 = vv;
            nn2 = nn * k;
            x = gcd(vv2, nn2);
            if (mzh.find({ vv2 / x, nn2 / x }) != mzh.end()) {
                vv = vv2 / x;
                nn = nn2 / x;
            }
        }
        else {
            if (poh) {
                result.push_back(p[r] - p[l - 1]);
                //cout << p[r] - p[l - 1] << endl;
            }
            else {
                ans = 0;
                int num = lower_bound(all(drobi), make_pair(vv, nn)) - drobi.begin();
                for (auto it : usless) {
                    int i1 = lower_bound(all(keys[it]), l) - keys[it].begin();
                    int i2 = upper_bound(all(keys[it]), r) - keys[it].begin();
                    ans += (i2 - i1) * refr[it][num];
                }
                result.push_back(ans);
                //cout << ans << endl;
            }
        }
    }
    return result;
}

